webpackJsonp([0xa2db99f7d283],{332:function(A,a){A.exports={data:{markdownRemark:{html:'<p>In the Previous post I just sent the data from my Sense Hat to AWS and saved it in Amazon DynamoDB. In this post I decided to show some graphs and chart on the dashboard using Kibana and Amazon ElasticSearch.</p>\n<p>Kibana is basically an open source plug-in for elastic search which creates nice dashboard very simple and easy. Since I already have data sent to AWS IoT, one of the rules that I can leverage on is send it to ElasticSearch. Before creating the rule I need to have a domain in ElasticSearch so I can send data to index in it so I browse to my ElasticSearch console and create new domain (be careful when you want to choose a server, the free one is not default).</p>\n<p>Since I already know the steps, I put a mapping in my domain and make a field for time stamp. The reason is that in kibana, we need a time field so we can show temperature based on that and the time that we send from sensor is not really acceptable type for kibana so I tag a time stamp in AWS IoT and in mapping I’d say what is the type is. For doing that I use Postman but also you can do it with this command:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/kibana-elastic-1-fb7dbaa6e26bc5ba651dcf26e748cb27-96788.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 33.05555555555556%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="kibana elastic 1"\n        title=""\n        src="/blog/static/kibana-elastic-1-fb7dbaa6e26bc5ba651dcf26e748cb27-f8fb9.jpg"\n        srcset="/blog/static/kibana-elastic-1-fb7dbaa6e26bc5ba651dcf26e748cb27-e8976.jpg 148w,\n/blog/static/kibana-elastic-1-fb7dbaa6e26bc5ba651dcf26e748cb27-63df2.jpg 295w,\n/blog/static/kibana-elastic-1-fb7dbaa6e26bc5ba651dcf26e748cb27-f8fb9.jpg 590w,\n/blog/static/kibana-elastic-1-fb7dbaa6e26bc5ba651dcf26e748cb27-85e3d.jpg 885w,\n/blog/static/kibana-elastic-1-fb7dbaa6e26bc5ba651dcf26e748cb27-96788.jpg 1080w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Now I get back to IoT console and make a new rule like this:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/kibana-elastic-2-5dc9b33c063bb5599af76c7b30e16dc0-94d19.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.33108866442199%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="kibana elastic 2"\n        title=""\n        src="/blog/static/kibana-elastic-2-5dc9b33c063bb5599af76c7b30e16dc0-f8fb9.jpg"\n        srcset="/blog/static/kibana-elastic-2-5dc9b33c063bb5599af76c7b30e16dc0-e8976.jpg 148w,\n/blog/static/kibana-elastic-2-5dc9b33c063bb5599af76c7b30e16dc0-63df2.jpg 295w,\n/blog/static/kibana-elastic-2-5dc9b33c063bb5599af76c7b30e16dc0-f8fb9.jpg 590w,\n/blog/static/kibana-elastic-2-5dc9b33c063bb5599af76c7b30e16dc0-85e3d.jpg 885w,\n/blog/static/kibana-elastic-2-5dc9b33c063bb5599af76c7b30e16dc0-94d19.jpg 891w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>After Creating a rule, it is time to send data from SenseHat. So I push the joy stick up for couple of times. Now when I check my domain’s index in ElasticSearch it looks like this</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/kibana-elastic-3-79a414e4b9a88b9cca0d8a07bae56c20-4e0a9.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 28.037383177570092%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="kibana elastic 3"\n        title=""\n        src="/blog/static/kibana-elastic-3-79a414e4b9a88b9cca0d8a07bae56c20-f8fb9.jpg"\n        srcset="/blog/static/kibana-elastic-3-79a414e4b9a88b9cca0d8a07bae56c20-e8976.jpg 148w,\n/blog/static/kibana-elastic-3-79a414e4b9a88b9cca0d8a07bae56c20-63df2.jpg 295w,\n/blog/static/kibana-elastic-3-79a414e4b9a88b9cca0d8a07bae56c20-f8fb9.jpg 590w,\n/blog/static/kibana-elastic-3-79a414e4b9a88b9cca0d8a07bae56c20-85e3d.jpg 885w,\n/blog/static/kibana-elastic-3-79a414e4b9a88b9cca0d8a07bae56c20-4e0a9.jpg 963w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>So I push couple of times more the joystick to have more data points, then I click on the Kibana link available on ElasticSearch console to configure my Kibana to have a line chart with my values as a time series.</p>\n<p>First step is “Configure an index pattern”, so I write my Index name which is “sensehat” and it shows me my time-field name which is datetime (I did it in the first step with a PUT call in my domain).After creating my index, I go on discover page and choose my fields which are datetime and temperature. Now it is time to create my line chart, so I go to Visualize page and create a line chart from a new search. I choose Y axis average of temperature and X axis Date Histogram. Run and here it is</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/blog/static/kibana-elastic-4-29f7b1fd05cf06eb5576518ae7074678-96788.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 42.87037037037037%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="kibana elastic 4"\n        title=""\n        src="/blog/static/kibana-elastic-4-29f7b1fd05cf06eb5576518ae7074678-f8fb9.jpg"\n        srcset="/blog/static/kibana-elastic-4-29f7b1fd05cf06eb5576518ae7074678-e8976.jpg 148w,\n/blog/static/kibana-elastic-4-29f7b1fd05cf06eb5576518ae7074678-63df2.jpg 295w,\n/blog/static/kibana-elastic-4-29f7b1fd05cf06eb5576518ae7074678-f8fb9.jpg 590w,\n/blog/static/kibana-elastic-4-29f7b1fd05cf06eb5576518ae7074678-85e3d.jpg 885w,\n/blog/static/kibana-elastic-4-29f7b1fd05cf06eb5576518ae7074678-96788.jpg 1080w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Hope you enjoy it and remeber that with kibana you can create a dashboard including different chart types and save it.</p>',frontmatter:{date:"September 23, 2016",path:"/elasticserach-kibana",title:"Visualizing Data on Kibana Dashboard Using Amazon ElasticSearch"}}},pathContext:{}}}});
